function formatLocationArea(name) {
    function hyphenLowerToSpaceUpper(match) {
        return ' ' + match.slice(1).toUpperCase();
    }
    return name.replace(/\-([a-z])|\-\d/g, hyphenLowerToSpaceUpper);
}

